import React from "react";
import "./button.css";

const Button = ({ handleQuote, background }) => {
  return (
    <div className="arrow-container">
      <button
        style={{ background }}
        onClick={handleQuote}
        className="arrow-button"
      >
       <FontAwesomeIcon icon="fa-solid fa-square-right" />
      </button>
    </div>
  );
};

export default Button;
